def numRescueBoats(people: 'List[int]', limit: int):
    cnt = 0
    people.sort()
    r = len(people) - 1
    l = 0
    while r >= 0:
        curr = people[r]
        if curr != float('inf'):
            if curr == limit:
                cnt += 1
                people[r] = float('inf')
            else:
                rem = limit - curr
                if people[l] <= rem:
                    people[l] = float('inf')
                    l+=1
                people[r] = float('inf')
                cnt += 1

        r -= 1

    return cnt


